import bisect
from collections import Counter
from typing import List


class Solution:
    def canMakePalindromeQueries(self, s: str, queries: List[List[int]]) -> List[bool]:
        n = len(s)
        m = n >> 1
        s1, s2 = s[:m], s[m:][::-1]

        diff = [i for i, cc in enumerate(zip(s1, s2)) if cc[0] != cc[1]]
        if len(diff) == 0:
            return [True] * len(queries)

        ps1, ps2 = [Counter()], [Counter()]
        for i, cc in enumerate(zip(s1, s2)):
            c1, c2 = cc
            ps1.append(ps1[-1] + Counter({c1: 1}))
            ps2.append(ps2[-1] + Counter({c2: 1}))
        if ps1[-1] != ps2[-1]:
            return [False] * len(queries)

        def cover_diff(l0, r0, l1, r1):
            if (l0, r0) > (l1, r1):
                l0, r0, l1, r1 = l1, r1, l0, r0

            if min(l0, l1) > diff[0] or max(r0, r1) < diff[-1]:
                return False

            di0 = bisect.bisect_right(diff, r0)
            if di0 < len(diff):
                return l1 <= diff[di0]
            else:
                return True

        def match(a, b):
            return ps1[b + 1] - ps1[a] == ps2[b + 1] - ps2[a]

        def cover_counter(x, y):
            for c, f in y.items():
                if x[c] < f:
                    return False
            return True

        def match_intersect(a, b, c, d):
            if a <= c <= b <= d:
                if not match(a, d):
                    return False
                count1 = ps1[b + 1] - ps1[a]
                count2 = ps2[d + 1] - ps2[c]
                return cover_counter(count1, ps2[c] - ps2[a]) and cover_counter(count2, ps1[d + 1] - ps1[b + 1])
            elif c <= a <= d <= b:
                if not match(c, b):
                    return False
                count1 = ps1[b + 1] - ps1[a]
                count2 = ps2[d + 1] - ps2[c]
                return cover_counter(count1, ps2[b + 1] - ps2[d + 1]) and cover_counter(count2, ps1[a] - ps1[c])
            else:
                return match(min(a, c), max(b, d))

        res = []
        for query in queries:
            a, b, c, d = query
            c, d = n - 1 - d, n - 1 - c
            if not cover_diff(a, b, c, d):
                res.append(False)
                continue

            if c > b or a > d:
                res.append(match(a, b) and match(c, d))
            else:
                res.append(match_intersect(a, b, c, d))

        return res


